INSERT INTO warehouse.materials (material_id, name, description)
VALUES
    ('59c1088e-df7d-4a6e-be9d-352d1d50ec44', 'Gips', 'Gips is een zacht sulfaatmineraal bestaande uit calciumsulfaatdihydraat. Het wordt vaak gebruikt in de bouwsector voor de productie van gips, gipsplaat en cement. Gips wordt in de landbouw ook gebruikt als bodemverbeteraar en meststof.'),
    ('258d0d5a-932b-45f5-99bb-9816cf20ec40', 'Ijzererts', 'IJzererts is een natuurlijk voorkomend mineraal waaruit ijzer wordt gewonnen. Het is een cruciale grondstof bij de productie van staal, dat op grote schaal wordt gebruikt in de bouw-, productie- en transportindustrie. Veel voorkomende soorten ijzererts zijn hematiet en magnetiet.'),
    ('242ad88b-3c9e-4f59-a93e-3e87a99ad5e5', 'Cement', 'Cement is een bindmiddel dat in de bouw wordt gebruikt en dat uithardt en aan andere materialen hecht om ze samen te binden. Het is een belangrijk ingrediënt in beton, mortel en stucwerk. Portlandcement, gemaakt van kalksteen en klei, is het meest voorkomende type.'),
    ('d69ee9e8-2755-490f-a11f-4e16bc0d8cf4', 'Petcode', 'Petcoke is een koolstofrijk vast materiaal afkomstig van olieraffinage. Vanwege de hoge calorische waarde wordt het gebruikt als brandstof bij energieopwekking, cementovens en andere industriële processen. Petcoke wordt ook gebruikt bij de productie van elektroden voor de aluminium- en staalindustrie. '),
    ('408ccae0-c49d-4535-b608-09e3931a7831', 'Slak', 'Slak is een bijproduct van het smeltproces dat wordt gebruikt om metalen uit hun ertsen te produceren. Het wordt in de bouw gebruikt als aggregaat in beton, in de wegenbouw en als grondstof bij de cementproductie. Slak helpt de duurzaamheid en sterkte van beton te verbeteren.');
